import axios from "axios";


function Registration(){
    const [status, setStatus] = useState({email: '', username:'', password: ''});

    function handleChange(e){
        const username = e.target.value;
        setState(prevState => ({
            ...prevState,
            fName: 'your updated value here'
         }));
    }

    return(
        <div>
            <form onSubmit = {handleSubmit}>
                <label>
                    Username:<br/>
                    <input type="text" value={status.email} onChange={(e) => handleChange(e)} /><br/>
                </label>
                <label>
                    Email:<br/>
                    <input type="text" value={status.username} onChange={(e) => handleChange(e)} /><br/>
                </label>
                <label>
                    Password:<br/>
                    <input type="text" value={status.password} onChange={(e) => setPassword(e.target.value)} /><br/>
                </label>
                <input type = "submit" value = "Submit"></input>
            </form>
            {status.email}<br/>
            {status.username} <br/>
            {status.password} <br/>

        </div>
    );
}


export default Registration;
